    )
}
  
  const addAnotherTopic=()=>{
    console.log("add another topic is called....");
  
  }

  const examDetails = async (examId) => {
    console.log("exam Details is called....");
    console.log(examId);
    const map = {
      examId: examId,
    };
    // const examId= examId;
    // const response = await fetch(
    //   "https://localhost:8443/onlineexam/control/getExamTopicEvent",
    //   {
