            <label
              htmlFor="exampleInputEmail1"
              className="form-label float-start"
            >
              TopicId*:
            </label>
            <input
              type="text"
              id="examid"
              className="form-control "
              placeholder="TopicId * eg(1)"
              name="examId"
              // value={examid}
              // onChange={(e) => setexamid(e.target.value)}
            />
            <p id="p1" className="text-danger"></p>
          </div>
          <div className="mb-3">
            <label
              htmlFor="exampleInputEmail1"
              className="form-label float-start"
            >
              Percentage:
            </label>
            <input
              type="text"
              id="examid"
              className="form-control "
              placeholder="Percentage * eg(100%)"
              name="examId"
              // value={examid}
              // onChange={(e) => setexamid(e.target.value)}
            />
            <p id="p1" className="text-danger"></p>
          </div>
          <div className="mb-3">
